<?php

use Illuminate\Database\Seeder;

class CitiesTableSeeder extends Seeder
{
    /**
     * Run the database seeds.
     *
     * @return void
     */
    public function run()
    {
        DB::transaction(function () {
            $this->populateZipcodes();

            DB::table('cities')->delete();
            DB::unprepared($this->cities());

            //Schema::dropIfExists('zipcodes');
        });
    }

    private function populateZipcodes()
    {
        Schema::dropIfExists('zipcodes');
        DB::unprepared($this->createZipcodes());
			$chunks = array_chunk($this->zipcodes(), 100);
			foreach ($chunks as $zipcodes) {
				DB::table('zipcodes')->insert($zipcodes);
			}
    }

    private function createZipcodes()
    {
        $sql = "
            CREATE TABLE IF NOT EXISTS `zipcodes` (
                `zip` INT(5) DEFAULT NULL,
                `state` VARCHAR(2) DEFAULT NULL,
                `city` VARCHAR(16) DEFAULT NULL,
                `lat` DECIMAL(8,6) DEFAULT NULL,
                `lng` DECIMAL(10,6) DEFAULT NULL
            ) ENGINE=MyISAM DEFAULT CHARSET=utf8;
        ";

        return $sql;
    }

