    private function cities()
    {
        $sql = "
            INSERT INTO cities (
                SELECT
                    NULL, s.id, UUID(), z.city, z.zip
                FROM
                    zipcodes AS z
                        INNER JOIN
                    states AS s ON s.code COLLATE utf8_general_ci = z.state COLLATE utf8_general_ci
                        AND s.country_id = 233
            );
        ";

        return $sql;
    }
